          <div class="">
            <div class="flex  mb-3">
              <span class="bg-blue-100 text-blue-800 text-lg font-bold w-8 h-8 rounded-full flex items-center justify-center mr-3">3</span>
              <h3 class="text-lg font-semibold">Je récupère mes fournitures</h3>
            </div>
            <p class="text-gray-600 text-sm">
              Je peux me faire livrer en 24H ou retirer mes fournitures en magasin dès 2H.
            </p>
          </div>
